    def count(self, query, projection=None):
        """
        pymongo 查询数据操作
        :param query:
        :param projection:
        :return:
        """

        if projection:
            res = self.col.count_documents(query, projection)
        else:
            res = self.col.count_documents(query)
        return res

    def find(self, query, projection=None):
        """
        pymongo 查询数据操作
        :param query:
        :param projection:
        :return:
        """
        if projection:
            res = self.col.find(query, projection)
        else:
            res = self.col.find(query)
        return res

    async def putBytes(self, bytes, name, format="png"):
        try:
            res = await self.fs.upload_from_stream(
                source=bytes,
                filename=name,
                metadata={'format': format})
        except Exception as e:
            print("Exception ==>> %s " % e)
        return res

    async def get(self, id):
        gf = None
        try:
            gf = await self.fs.open_download_stream(file_id=ObjectId(id))
            im = await gf.read()  # read the data in the GridFS
            dic = {}
            dic["chunk_size"] = gf.chunk_size
            dic["metadata"] = gf.metadata
            dic["length"] = gf.length
            dic["upload_date"] = gf.upload_date
            dic["name"] = gf.name
            dic["content_type"] = gf.content_type
            # dic["format"] = gf.format
            return (im, dic)
        except Exception as e:
            print(e)
            return (None, None)
        finally:
            if gf:
                gf.close()


